import React from 'react';
import Post from './Post';

import img from '../../Images/Sasuke.jpg';

class PostList extends React.Component{

  constructor(props){
    super(props);
  }

  render(){
    return(
      <div className="postLists">
        <Post description={description} image={img} date={"June 1st"} title={"Fourth Post"} />
        <Post image={img} date={"May 31st"} title={"Third Post"} />
        <Post image={img} date={"May 30th"} title={"Second Post"} />
        <Post image={img} date={"May 29th"} title={"First Post"} />
      </div>
    )
  }
}

export default PostList
